import React, { useEffect } from "react";
import clsx from "clsx";
import jwt from "jsonwebtoken";
import PersonIcon from "@material-ui/icons/Person";
import PowerSettingsNewIcon from "@material-ui/icons/PowerSettingsNew";
import {
  makeStyles,
  useTheme,
  Drawer,
  Link,
  Box,
  TextField,
  Container,
  CssBaseline,
  AppBar,
  Toolbar,
  Avatar,
  List,
  Typography,
  Divider,
  IconButton,
  ListItem,
  ListItemIcon,
  ListItemText,
  Select,
  Button,
  MenuItem,
  Menu,
  Dialog,
  Tabs,
  Tab,
} from "@material-ui/core";
import MenuIcon from "@material-ui/icons/Menu";
import ChevronRightIcon from "@material-ui/icons/ChevronRight";
import ChevronLeftIcon from "@material-ui/icons/ChevronLeft";
import InboxIcon from "@material-ui/icons/MoveToInbox";
import AccountCircle from "@material-ui/icons/AccountCircle";
import MailIcon from "@material-ui/icons/Mail";
import axios from "axios";
import Slide from "@material-ui/core/Slide";
import AccountCircleIcon from "@material-ui/icons/AccountCircle";
import { blue } from "@material-ui/core/colors";
import Comp from "./components/Comp";
import Profile from "./components/Profile";
import Frontpage from "./components/Frontpage";

const drawerWidth = 240;

function Copyright() {
  return (
    <Typography variant="body2" color="textSecondary" align="center">
      {"Copyright Â© "}
      <Link color="inherit" href="#">
        Code Hacks
      </Link>{" "}
      {new Date().getFullYear()}
      {"."}
    </Typography>
  );
}

const Transition = React.forwardRef(function Transition(props, ref) {
  return <Slide direction="up" ref={ref} {...props} />;
});

const useStyles = makeStyles((theme) => ({
  root: {
    display: "flex",
  },
  paper: {
    marginTop: theme.spacing(8),
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: blue,
  },
  form: {
    width: "100%", // Fix IE 11 issue.
    marginTop: theme.spacing(1),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
  appBar: {
    transition: theme.transitions.create(["margin", "width"], {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
  },
  appBarShift: {
    width: `calc(100% - ${drawerWidth}px)`,
    marginLeft: drawerWidth,
    transition: theme.transitions.create(["margin", "width"], {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  hide: {
    display: "none",
  },
  drawer: {
    width: drawerWidth,
    flexShrink: 0,
  },
  drawerPaper: {
    width: drawerWidth,
  },
  drawerHeader: {
    display: "flex",
    alignItems: "center",
    padding: theme.spacing(0, 1),
    ...theme.mixins.toolbar,
  },
  content: {
    flexGrow: 1,
    padding: theme.spacing(3),
    transition: theme.transitions.create("margin", {
      easing: theme.transitions.easing.sharp,
      duration: theme.transitions.duration.leavingScreen,
    }),
    marginLeft: -drawerWidth,
  },
  contentShift: {
    transition: theme.transitions.create("margin", {
      easing: theme.transitions.easing.easeOut,
      duration: theme.transitions.duration.enteringScreen,
    }),
    marginLeft: 0,
  },
}));

export default function PersistentDrawerLeft() {
  const classes = useStyles();
  const theme = useTheme();
  const [open, setOpen] = React.useState(false);
  const [openMenu, setOpenMenu] = React.useState(false);
  const [openDialog, setOpenDialog] = React.useState(false);
  const [openSignupDialog, setOpenSignupDialog] = React.useState(false);
  const [Userid, setUserid] = React.useState("");
  const [Password, setPassword] = React.useState("");
  const [isLogin, setisLogin] = React.useState(false);
  const [anchorEl, setAnchorEl] = React.useState(null);
  const [isProfile, setisProfile] = React.useState(false);
  const [role, setRole] = React.useState("User");
  const userMenu = ["UpcomingHack", "Results", "Help", "Aboutus"];
  const [cMenu, setcMenu] = React.useState(0);
  const adminMenu = ["Hackathon Page", "Declare Results", "Help"];
  const [userName, setuserName] = React.useState("");
  const [signup, setSignup] = React.useState({
    Role: "user",
    Userid: "",
    Password: "",
    Name: "",
    Email: "",
  });
  const [isValid, setIsValid] = React.useState(true);
  useEffect(() => {
    let token = localStorage.getItem("token");
    try {
      var x = jwt.verify(token, "123");
      // console.log(x);
      setisLogin(true);
      setRole(x.Role);
      setuserName(x.Userid);
      localStorage.setItem("Role", x.Role);
    } catch (e) {
      setisLogin(false);
      //    console.log(token);
    }
  });

  const handleMenuClose = () => {
    setOpenMenu(false);
  };

  // const handleDrawerChange = () => {
  //   console.log("id");
  //   // setcMenu(id);
  // };

  const handleMenu = (e) => {
    setAnchorEl(e.target);
    setOpenMenu(true);
  };

  const handleDrawerOpen = () => {
    setOpen(true);
  };

  const handleDrawerClose = () => {
    setOpen(false);
  };

  const handleClose = () => {
    setOpenDialog(false);
  };

  const handleSignupClose = () => {
    setOpenSignupDialog(false);
  };

  const loginEvent = () => {
    setOpenDialog(true);
  };

  const signupEvent = () => {
    setOpenSignupDialog(true);
  };

  const handleLoginChange = (e, id) => {
    if (id === "Userid") {
      setUserid(e.target.value);
    } else if (id === "Password") {
      setPassword(e.target.value);
    }
  };

  const handleSignupChange = (e, id) => {
    e.preventDefault();
    if (id === "Userid") {
      //console.log(/^[a-zA-Z0-9]{3,30}$/.test(e.target.value));

      setSignup({
        Role: signup.Role,
        Userid: e.target.value,
        Password: signup.Password,
        Name: signup.Name,
        Email: signup.Email,
      });
    } else if (id === "Role") {
      setSignup({
        Role: e.target.value,
        Password: signup.Password,
        Name: signup.Name,
        Email: signup.Email,
        Userid: signup.Userid,
      });
    } else if (id === "Password") {
      setSignup({
        Role: signup.Role,
        Password: e.target.value,
        Name: signup.Name,
        Email: signup.Email,
        Userid: signup.Userid,
      });
    } else if (id === "Name") {
      setSignup({
        Role: signup.Role,
        Name: e.target.value,
        Password: signup.Password,
        Userid: signup.Userid,
        Email: signup.Email,
      });
    } else if (id === "Email") {
      setSignup({
        Role: signup.Role,
        Email: e.target.value,
        Password: signup.Password,
        Name: signup.Name,
        Userid: signup.Userid,
      });
    }
  };

  const handleProfileMenu = (e, id) => {
    if (id === "logout") {
      localStorage.removeItem("token");
      setisLogin(false);
      setOpenMenu(false);
    } else if (id === "profile") {
      setisProfile(true);
      setOpenMenu(false);
    }
  };

  const handleSignupClick = (e) => {
    e.preventDefault();
    // console.log(signup);
    axios({
      method: "post",
      url: "http://localhost:4000/auth/signup",
      data: signup,
      headers: { "Content-Type": "application/json" },
    })
      .then(function (response) {
        //handle success
        console.log(response);
        window.location.reload(true);
      })
      .catch(function (response) {
        //handle error
        alert("Signup Failed");
      });
  };

  const handleLoginClick = (e) => {
    e.preventDefault();
    //  console.log("click");
    axios({
      method: "post",
      url: "http://localhost:4000/auth/login",
      data: JSON.stringify({ Userid: Userid, Password: Password }),
      headers: { "Content-Type": "application/json" },
    })
      .then(function (response) {
        //handle success
        console.log(response.data.token, response.status);
        localStorage.setItem("token", response.data.token);
        setOpenDialog(false);
      })
      .catch(function (response) {
        //handle error
        alert("Wrong UserId or Password");
        setOpenDialog(false);
      });
  };

  const handleOnLoad = () => {
    setcMenu(0);
    setisProfile(false);
  };

  const handleCompChange = (e, id) => {
    //  console.log(id);
    setcMenu(id);
    setOpen(false);
  };

  return (
    <div className={classes.root}>
      <div>
        <CssBaseline />
        <AppBar
          // color="primary"
          position="fixed"
          className={clsx(classes.appBar, {
            [classes.appBarShift]: open,
          })}
        >
          <Toolbar>
            {isLogin && (
              <IconButton
                color="inherit"
                aria-label="open drawer"
                onClick={handleDrawerOpen}
                edge="start"
                className={clsx(classes.menuButton, open && classes.hide)}
              >
                <MenuIcon />
              </IconButton>
            )}
            <div onClick={handleOnLoad} style={{ width: "85%" }}>
              <img
                style={{ height: "50px", width: "120px" }}
                src={
                  "data:image/jpeg;base64,"
                }
              />
              {/* <Typography variant="h6" noWrap>
                Code Hacks
              </Typography> */}
            </div>

            {isLogin && (
              <div>
                <IconButton
                  aria-label="account of current user"
                  aria-controls="menu-appbar"
                  aria-haspopup="true"
                  onClick={handleMenu}
                  color="inherit"
                  style={{ marginLeft: "100px" }}
                >
                  <AccountCircle />
                </IconButton>
                <Menu
                  id="menu-appbar"
                  anchorEl={anchorEl}
                  // anchorOrigin={{
                  //   vertical: "top",
                  //   horizontal: "right",
                  // }}
                  keepMounted
                  // transformOrigin={{
                  //   vertical: "top",
                  //   horizontal: "right",
                  // }}
                  open={openMenu}
                  onClose={handleMenuClose}
                >
                  {/* <Typography variant="h6">Hey {userName}</Typography> */}
                  <MenuItem onClick={(e) => handleProfileMenu(e, "profile")}>
                    <PersonIcon /> &nbsp; Profile
                  </MenuItem>

                  <MenuItem onClick={(e) => handleProfileMenu(e, "logout")}>
                    <PowerSettingsNewIcon />
                    &nbsp; Logout
                  </MenuItem>
                </Menu>
              </div>
            )}

            {!isLogin && (
              <div>
                <Button color="inherit" onClick={loginEvent}>
                  Sign in
                </Button>
                <Button color="inherit" onClick={signupEvent}>
                  Sign up
                </Button>
              </div>
            )}
          </Toolbar>
        </AppBar>

        <Drawer
          className={classes.drawer}
          variant="persistent"
          anchor="left"
          open={open}
          classes={{
            paper: classes.drawerPaper,
          }}
        >
          <div
            className={classes.drawerHeader}
            style={{ justifyContent: "flex-end" }}
          >
            <Typography variant="h6" gutterBottom>
              {" "}
              Hey {userName}
            </Typography>

            <div>
              <IconButton onClick={handleDrawerClose}>
                {theme.direction === "ltr" ? (
                  <ChevronLeftIcon />
                ) : (
                  <ChevronRightIcon />
                )}
              </IconButton>
            </div>
          </div>
          <Divider />
          <List>
            {role === "User"
              ? userMenu.map((text, index) => (
                  <ListItem
                    // button
                    key={index}
                    button
                    onClick={(e) => handleCompChange(e, index)}
                  >
                    <ListItemText primary={text} />
                  </ListItem>
                ))
              : adminMenu.map((text, index) => (
                  <ListItem
                    key={text}
                    button
                    onClick={(e) => handleCompChange(e, index)}
                  >
                    <ListItemText primary={text} />
                  </ListItem>
                ))}
          </List>
          {/* <Divider /> */}
        </Drawer>

        {/*Dialog Login*/}
        <Dialog
          open={openDialog}
          TransitionComponent={Transition}
          keepMounted
          onClose={handleClose}
          aria-labelledby="alert-dialog-slide-title"
          aria-describedby="alert-dialog-slide-description"
        >
          <Container component="main" maxWidth="xs">
            <CssBaseline />
            <div className={classes.paper}>
              <Avatar className={classes.avatar}>
                <AccountCircleIcon />
              </Avatar>
              <Typography component="h1" variant="h5">
                Sign in
              </Typography>
              <form className={classes.form} noValidate>
                <TextField
                  variant="outlined"
                  margin="normal"
                  required
                  fullWidth
                  id="email"
                  label="Email Address"
                  name="email"
                  autoComplete="email"
                  autoFocus
                  onChange={(e) => {
                    handleLoginChange(e, "Userid");
                  }}
                />
                <TextField
                  variant="outlined"
                  margin="normal"
                  required
                  fullWidth
                  name="Password"
                  label="Password"
                  type="Password"
                  id="Password"
                  autoComplete="current-password"
                  onChange={(e) => {
                    handleLoginChange(e, "Password");
                  }}
                />
                {/* <FormControlLabel
            control={<Checkbox value="remember" color="primary" />}
            label="Remember me"
          /> */}
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  color="primary"
                  className={classes.submit}
                  onClick={handleLoginClick}
                >
                  Sign In
                </Button>
              </form>
            </div>
            <Box mt={8}>
              <Copyright />
            </Box>
          </Container>
        </Dialog>
        {/*Dialog Signup */}
        <Dialog
          open={openSignupDialog}
          TransitionComponent={Transition}
          keepMounted
          onClose={handleSignupClose}
          aria-labelledby="alert-dialog-slide-title"
          aria-describedby="alert-dialog-slide-description"
        >
          <Container component="main" maxWidth="xs">
            <CssBaseline />
            <div className={classes.paper}>
              <Avatar className={classes.avatar}>
                <AccountCircleIcon />
              </Avatar>
              <Typography component="h1" variant="h5">
                Sign up
              </Typography>
              <form className={classes.form} noValidate>
                <Typography>Role:</Typography>
                <Select
                  labelId="demo-simple-select-label"
                  label="Role"
                  id="demo-simple-select"
                  value={signup.Role}
                  style={{ width: "100%" }}
                  variant="outlined"
                  onChange={(e) => handleSignupChange(e, "Role")}
                >
                  <MenuItem value={"User"}>User</MenuItem>
                  <MenuItem value={"Admin"}>Admin</MenuItem>
                </Select>

                <TextField
                  error={isValid}
                  variant="outlined"
                  margin="normal"
                  required={true}
                  fullWidth
                  id="Userid"
                  label="User Name"
                  name="Userid"
                  autoComplete="Userid"
                  autoFocus
                  onChange={(e) => {
                    handleSignupChange(e, "Userid");
                  }}
                />
                <TextField
                  variant="outlined"
                  margin="normal"
                  required
                  fullWidth
                  name="Password"
                  label="Password"
                  type="Password"
                  id="Password"
                  autoComplete="current-Password"
                  onChange={(e) => {
                    handleSignupChange(e, "Password");
                  }}
                />
                <TextField
                  variant="outlined"
                  margin="normal"
                  required
                  fullWidth
                  id="Name"
                  label="Name"
                  name="Name"
                  autoFocus
                  onChange={(e) => {
                    handleSignupChange(e, "Name");
                  }}
                />
                <TextField
                  variant="outlined"
                  margin="normal"
                  required
                  fullWidth
                  id="email"
                  label="Email Address"
                  name="email"
                  autoFocus
                  onChange={(e) => {
                    handleSignupChange(e, "Email");
                  }}
                />
                <Button
                  type="submit"
                  fullWidth
                  variant="contained"
                  color="primary"
                  className={classes.submit}
                  onClick={handleSignupClick}
                >
                  Sign up
                </Button>
              </form>
            </div>
            <Box mt={8}>
              <Copyright />
            </Box>
          </Container>
        </Dialog>
      </div>

      <div style={{ position: "absolute", marginTop: "100px", width: "100%" }}>
        {isLogin ? (
          isProfile ? (
            <Profile role={role} />
          ) : (
            <div>
              <Comp role={role} value={cMenu} />
            </div>
          )
        ) : (
          <Frontpage />
        )}
      </div>
    </div>
  );
}
